import React from "react";
// import { BrowserRouter as Router } from "react-router-dom";
import { Routes, Route, NavLink, Outlet } from "react-router-dom";

function Home() {
  return (
    <main className="homepage">
      <h1>Hola!!</h1>
      <p>Welcome to my Webpage 🙏🏿🙏🏿</p>
      <p>
        Click the link below to contact me if you have any questions or would
        like to connect.
      </p>
      <NavLink
        // style={({ isActive }) =>
        //   isActive ? { color: "red" } : { color: "black" }
        // }
        className="navigate"
        to="/"
      >
        Home Page
      </NavLink>
      <NavLink className="navigate" to="/blog">
        Read my Blog
      </NavLink>
      <NavLink className="navigate" to="users">Our Users</NavLink>
      <NavLink className="navigate" to="/contact">
        Contact page
      </NavLink>
    </main>
  );
}

function Blog() {
  return (
    <main className="blog">
      <h1>You can check out some of our recipees and food blogs here👇!</h1>
      <p className="like">PS: Be sure to leave a heart if you like them🥰🥰🥰</p>
      <NavLink
        className="navigate"
        to="/"
      >
        Home Page
      </NavLink>
      <NavLink className="navigate" to="/blog">
        Read my Blog
      </NavLink>
      <NavLink className="navigate" to="/users">Our Users</NavLink>
      <NavLink className="navigate" to="/contact">
        Contact page
      </NavLink>
    </main>
  );
}

function Users() {
  return (
    <main className="users">
      <h1>Our recipes have been tested and are trusted by many popular chefs, in Nigeria and beyond. Check out some of our users here!</h1>




      <NavLink
        className="navigate"
        to="/"
      >
        Home Page
      </NavLink>
      <NavLink className="navigate" to="/blog">
        Read my Blog
      </NavLink>
      <NavLink className="navigate" to="/users">Our Users</NavLink>
      <NavLink className="navigate" to="/contact">
        Contact page
      </NavLink>
    </main>
  );
}

function Contact() {
  return (
    <main className="contact-me">
      <h1> Contact me</h1>
      <p className="contact">Fill the form below to reach out to me.</p>

      <NavLink
        className="navigate"
        to="/"
      >
        Home Page
      </NavLink>
      <NavLink className="navigate" to="/blog">
        Read my Blog
      </NavLink>
      <NavLink className="navigate" to="/users">Our Users</NavLink>
      <NavLink className="navigate" to="/contact">
        Contact page
      </NavLink>
      <NavLink className="navigate" to="/contact/signup">
        Sign Up
      </NavLink>
      <div>
        <Outlet />
      </div>
    </main>
  );
}

function SignUp() {
  return (
    <main className="sign-up">
      <h1> Sign up to my weekly newsletter</h1>
    </main>
  );
}

function NotFound() {
  return (
    <div className="notFound">
      <h1>404!</h1>
      <h1>Oops, you seem to be lost!</h1>
      <p>Here are some useful links:</p>
      <NavLink to="/" className="navigate">
        Home
      </NavLink>
      <NavLink to="/contact" className="navigate">
        Contact
      </NavLink>
      <NavLink className="navigate" to="users">Our Users</NavLink>
      <NavLink to="/contact/signup" className="navigate">
        Signup
      </NavLink>
    </div>
  );
}

function App() {
 const users = [
  {
    id: "1",
    title: "Chef Tolani Tayo Osikoya a.k.a Diary of a Kitchen Lover",
    urlToImage: "https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.bellanaija.com%2F2021%2F08%2Ftolani-diary-of-a-kitchen-lover%2F&psig=AOvVaw35jP2wQzrhzCyJBV8m2h0X&ust=1667020351102000&source=images&cd=vfe&ved=0CAwQjRxqFwoTCOiiiqiPgfsCFQAAAAAdAAAAABAE",
    description: "This is one of our most trusted users",
    url: <a href="#me">Check out what she has to say about our recipes</a>
  }

]
